class Solution:
    def distMoney(self, money: int, children: int) -> int:
        def distribute(remaining_money: int, idx: int, count_eight: int) -> int:
            # If all the money is distributed and all children received money
            if remaining_money == 0 and idx == children:
                return count_eight
            # If money is not enough to distribute to all children
            if remaining_money < (children - idx) or idx == children:
                return -1

            max_count = -1
            # Enumerate over the possible amounts to give to the current child
            for amount in range(1, remaining_money + 1):
                # Skip if the amount is 4 dollars
                if amount == 4:
                    continue
                # Check if the amount is 8 dollars
                is_eight = 1 if amount == 8 else 0
                max_count = max(max_count, distribute(remaining_money - amount, idx + 1, count_eight + is_eight))
            return max_count

        # Start the distribution with the initial money, first child, and count of 8 dollars as 0
        return distribute(money, 0, 0)

