class Solution:

    def distMoney(self, money: int, children: int) -> int:
        if money < children:
            return -1
        if children == 2 and money == 4:
            return -1
        max_children_with_eight_dollars = money // 8
        if max_children_with_eight_dollars >= children:
            return children
        remaining_money = money - max_children_with_eight_dollars * 8
        if remaining_money >= children - max_children_with_eight_dollars and (remaining_money - (children - max_children_with_eight_dollars)) % 3 != 1:
            return max_children_with_eight_dollars
        max_children_with_eight_dollars -= 1
        remaining_money = money - max_children_with_eight_dollars * 8
        if remaining_money >= children - max_children_with_eight_dollars and (remaining_money - (children - max_children_with_eight_dollars)) % 3 != 1:
            return max_children_with_eight_dollars
        return -1
